import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

function Navbar() {
  const [userName, setUserName] = useState('');
  const [isHovered, setIsHovered] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const storedUserName = localStorage.getItem('userName');
    if (storedUserName) {
      setUserName(storedUserName);
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('userName');
    setUserName('');
    navigate('/login');
  };

  const linkStyles = {
    fontSize: '1.1rem',
    fontWeight: '600',
    textTransform: 'uppercase',
    letterSpacing: '1px',
    padding: '8px 12px',
    textDecoration: 'none',
    color: 'white',
    transition: 'color 0.3s ease, transform 0.3s ease',
  };

  const navStyles = {
    backgroundColor: '#2980b9', // A more modern blue color
    padding: '12px 0',
    boxShadow: '0 10px 30px rgba(0, 0, 0, 0.2)', // Stronger shadow for a bolder look
    position: 'fixed',
    width: '100%',
    zIndex: 1000,
  };

  const welcomeStyle = {
    color: 'white',
    fontSize: '1.1rem',
    backgroundColor: '#27ae60',
    padding: '8px 20px',
    borderRadius: '20px',
    fontWeight: '600',
    textTransform: 'uppercase',
    marginRight: '10px', // Decrease spacing between welcome and logout button
    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.15)',
  };

  const logoutButtonStyles = {
    color: 'white',
    background: 'none',
    border: 'none',
    cursor: 'pointer',
    fontSize: '1.1rem',
    padding: '10px 20px',
    borderRadius: '20px',
    transition: 'background 0.3s ease, transform 0.3s ease',
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark" style={navStyles}>
      <div className="container-fluid">
        <a className="navbar-brand" href="#" style={{ fontSize: '1.8rem', fontWeight: 'bold' }}>
          Quiz App
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto" style={{ display: 'flex', justifyContent: 'center' }}>
            <li className="nav-item">
              <Link className="nav-link" to="/home" style={linkStyles}>
                Home
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/about" style={linkStyles}>
                About Us
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/quiz" style={linkStyles}>
                Quiz
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/profile" style={linkStyles}>
                Profile
              </Link>
            </li>

            {/* Align Welcome and Logout to the right side */}
            <div style={{ marginLeft: 'auto', display: 'flex', alignItems: 'center' }}>
              {userName ? (
                <>
                  <span className="nav-link" style={welcomeStyle}>
                    Welcome, <span style={{ fontWeight: 'bold' }}> {userName} </span>
                  </span>
                  <button
                    className="nav-link"
                    style={{
                      ...logoutButtonStyles,
                      backgroundColor: isHovered ? '#c0392b' : 'none',
                      transform: isHovered ? 'scale(1.1)' : 'scale(1)',
                    }}
                    onClick={handleLogout}
                    onMouseEnter={() => setIsHovered(true)}
                    onMouseLeave={() => setIsHovered(false)}
                  >
                    Logout
                  </button>
                </>
              ) : (
                <Link className="nav-link" to="/login" style={linkStyles}>
                  Login
                </Link>
              )}
            </div>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
